import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends React.Component{
  constructor(props) {
    super(props);
    this.state = {name: "React!"}
  }

  render(){
    return (
      <h1>Welcome back to {this.state.name}!</h1>
    );
  }
}



export default App;
